"use strict";window.addEventListener("load",()=>{document.querySelectorAll(".title").forEach(e=>{let t=e.innerHTML;e.innerHTML="";for(let n=0;n<t.split("<br>").length;n++){e.insertAdjacentHTML("beforeend","<span></span>");let s=document.querySelectorAll("span")[document.querySelectorAll("span").length-1];s.insertAdjacentHTML("beforeend",`<span class="_text">${t.split("<br>")[n]}<span>`),s.insertAdjacentHTML("afterbegin",`<span class="_shadow">${t.split("<br>")[n]}<span>`)}}),$(".path__list").slick({arrows:!0,dots:!0,slidesToShow:1,slidesToScroll:1,prevArrow:$(".path__toggle._prev"),nextArrow:$(".path__toggle._next"),appendArrows:$(".path__slider"),appendDots:$(".path__dots"),infinite:!0})});